    display: flex;
    flex-flow: column nowrap;
    width: 100%;

    justify-content: center;
}

.reservation-info {
    display: flex;
    flex-flow: column nowrap;
    margin: 50px;
    justify-content: center;




    h4 {
        font-size: 3rem;
        font-family: var(--fnt-alt);

        &::after {
            content:"";
            border-bottom: 2px solid var(--clr-light);
            width: 200px;
            padding-top: 45px;
            margin-left: 15px;
            z-index: -1;
            position: absolute;
        }
    }


    a {
        margin-top: 50px;
        width: 100px;
        align-self: center;
        padding-bottom: 15px;


        &:hover {
            border-bottom: 1px solid var(--clr-light);

        }

        &:active {
            border-bottom: 1px solid var(--clr-light);

        }

    }
}


