    width: 80%;
    display: flex;
    flex-flow: row nowrap;
    margin-top: 150px;
    align-self: center;
    justify-self: center;
    border: 1px solid var(--clr-light);
    padding: 50px;
    font-size: 1.5rem;
    justify-content: center;

