        padding: 10px;
    }

    input {
        color: var(--clr-light);
        border: 1px solid var(--clr-light);
        background-color: var(--bg-Dark);
        box-sizing: border-box;
        font-size: 1.2rem;
        padding: 10px;
    }

    select {
        color: var(--clr-light);
        border: 1px solid var(--clr-light);
        background-color: var(--bg-Dark);
        box-sizing: border-box;
        font-size: 1.2rem;
        padding: 10px;

    }

    #form-submit {
        margin-left: 50px;

    }
